import React, { Component } from 'react';

import 'antd/dist/antd.css';
import { Menu, Button } from 'antd';
import {
  AppstoreOutlined,
  MenuUnfoldOutlined,
  MenuFoldOutlined,
  PieChartOutlined,
  DesktopOutlined,
  ContainerOutlined,
  MailOutlined,
} from '@ant-design/icons';

const { SubMenu } = Menu;

class Navigation extends Component {

    constructor(props, context) {
        super(props);

       this.state = {
        collapsed: false
      }
    }

    render() {
        return (
          <div style={{ width: 256 ,height:'100%'}}>
          <Menu
            defaultSelectedKeys={['1']}
            defaultOpenKeys={['sub1']}
            mode="inline"
            theme="dark"
            inlineCollapsed={this.state.collapsed}
          >
            <Menu.Item key="1">
              <PieChartOutlined />
              <span>Option 1</span>
            </Menu.Item>
            <Menu.Item key="2">
              <DesktopOutlined />
              <span><Link href="#components-anchor-demo-basic" title="대화방" /></span>
            </Menu.Item>
            <Menu.Item key="3">
              <ContainerOutlined />
              <span>Option 3</span>
            </Menu.Item>
          </Menu>
        </div>
        );
    }
}
export default Navigation;
